CREATE TABLE REGIONI_COVID19(
   data                       VARCHAR(19) NOT NULL
  ,codice_regione             NUMBER NOT NULL
  ,denominazione_regione      VARCHAR2(21) NOT NULL
  ,ricoverati_con_sintomi     INTEGER 
  ,terapia_intensiva          INTEGER 
  ,totale_ospedalizzati       INTEGER 
  ,isolamento_domiciliare     INTEGER 
  ,totale_positivi            INTEGER 
  ,variazione_totale_positivi INTEGER 
  ,nuovi_positivi             INTEGER 
  ,dimessi_guariti            INTEGER 
  ,deceduti                   INTEGER 
  ,totale_casi                INTEGER 
  ,tamponi                    INTEGER 
  ,casi_testati               INTEGER 
  ,note_it                    VARCHAR(10)
  ,note_en                    VARCHAR(10)
  ,FOREIGN KEY (codice_regione,denominazione_regione) REFERENCES REGIONI (codice_regione,denominazione_regione) ON DELETE CASCADE
  ,PRIMARY KEY(data,codice_regione,denominazione_regione)
);

